const CustomButton = ({ action, children, type, disabled, label }) =>{

    return(
        <>
            <Button
                // className={classes[handleClasse(type)]}
                onClick={() => action && [action()]}
                disabled={disabled}
                label={label}
                type={type}
            >
                {children}
            </Button>
        </>
    )
}

export default CustomButton;
